SELECT tipo_campo ,T.cd_material ,unid__neg ,centro_armaz ,cd_esp1 ,cd_esp2 ,cd_esp3 ,numeracao ,lote ,numero_serie ,total_entradas ,total_saidas ,quant_caixas ,preco_custo ,preco_compra ,preco_medio ,peso_bruto ,peso_liq ,dt_compra ,dt_validade ,case LIVRO.Situacao when 'Q' then 'Quarentena' when 'A' then 'Aprovado' when 'R' then 'Reprovado' when 'C' then 'Coletado' end SituacaoLivro
from :1 T :2 OUTER APPLY ( SELECT Situacao FROM LC_LIVRO(NOLOCK) WHERE LC_LIVRO.cd_Material = t.cd_material AND LC_LIVRO.Lote_Interno = t.Lote AND LC_LIVRO.cd_Unidade_Negocio IN ( SELECT GEUNIDNE.Cd_unidade_de_n FROM GEUNIDNE(NOLOCK) INNER JOIN GEUNIDNE Z ON z.campo9 = GEUNIDNE.campo9 WHERE z.Cd_unidade_de_n = t.Unid__Neg AND LC_LIVRO.Lote_Interno <> LC_LIVRO.Lote_Fornecedor) union all SELECT Situacao FROM LC_APROVACAO_PA(NOLOCK) WHERE LC_APROVACAO_PA.Codigo_Material = t.cd_material AND LC_APROVACAO_PA.Lote = t.Lote
) Livro :3 ORDER BY chave_ordem
